	('home_location_title','Start RiLeiplausch 2018'),
	('info_text','<h3>Spielregeln</h3> \n<h5>Wie funktioniert das Spiel?</h5>\nWer am Ende am meisten Punkte hat, gewinnt. Punkte könnt Ihr auf drei Arten machen:\n<ul>\n	<li><b>Stationen erobern</b><br/> Auf dem ganzen Spielfeld gibt es Stationen, die deine Gruppe einnehmen kann. Klickt auf die\n		Station, mach ein Foto <b>von deiner ganzen Gruppe</b> und lade das Foto hoch. Damit gehört die Station euch!\n		Zumindest solange sie euch kein anderes Team wegschnappt. <b>Alle 5 Minuten</b> bekommt Ihr <b>Punkte für jede Station</b> in\n		eurem Besitz.</b><br/><br/>\n	</li>\n	<li><b>Mister X</b><br/> In der Stadt ist ein oder zwei Mister X unterwegs. Du siehst sie anhand vom Pio-X Logo auf der Karte.\n		Sobald Ihr einen gefangen habt, bekommt Ihr einen Passcode, welcher euch <b>viele Bonuspunkte</b> bringt.<br/><br/>\n	</li>\n	<li><b>Rätsel lösen</b><br/> Auf der Karte gibt es einige Fragezeichen. Wenn ihr bei einem Fragezeichen seid, könnt ihr die\n		Frage freischalten und danach lösen. Es gibt Einzelfragen, aber auch Rätselserien. Rätselserien geben komplett\n		gelöst deutlich mehr Punkte als Einzelrätsel.\n	</li>\n</ul>\n<h5>Regeln</h5>\n<ul>\n	<li>Nur zu Fuss oder mit dem ÖV unterwegs sein. <b>Velos sind nicht erlaubt.</b></li>\n	<li>Auf dem Foto muss immer die <b>ganze Gruppe</b> und die Station im Bild sein.</li>\n	<li>Die Gruppe darf sich nicht trennen.</li>\n	<li>Wir sind Pfadis und verhalten uns auch so.</li>\n</ul>\n<h5>Häufige Fragen / Tipps &amp; Tricks</h5>\n<ul>\n	<li>Schalte den Bildschirm vom Handy aus, wenn du unterwegs bist und die Karte nicht brauchst. Das Spiel braucht\n		viel Akku und ihr wollt nicht nach dem halben Spiel aufgeben müssen.\n	</li>\n	<li>Standortbestimmung einschalten: (Falls der Standort nicht richtig angezeigt wird)\n		<ul>\n			<li><b>Android / Google Handy:</b><br/> In den Einstellungen auf „Standort“. Der Modus muss dort auf „Hohe\n				Genauigkeit“ gestellt werden. Der Energiesparmodus muss ausgeschaltet sein. Bei Android immer die App\n				verwenden. Falls der Standort nicht sofort angezeigt wird, <b>wechselt auf eine andere App und dann wieder in die Pio-X App</b> zurück.<br/><br/>\n			</li>\n			<li><b>iPhone / Apple Handy:</b><br/> In den Einstellungen auf „Datenschutz“ und dort auf „Ortungsdienste“.</li>\n		</ul>\n	</li>\n	<li>Es können mehrere Personen pro Team gleichzeitig eingeloggt sein.</li>\n</ul> \n<h5>Hilfe!</h5>\n<p>\n	Wenn ihr Probleme irgendwelcher Art habt, meldet euch <b>per Whatsapp oder SMS</b> auf der\n	Notfallnummer. Meldet euch immer per Chat, Anrufe nur bei einem Notfall! Die Notfallnummer lautet 079 542 79 35.<br>\n	<b>Bei medizinischen Notfällen direkt die Ambulanz (144) anrufen</b> und anschliessend die Notfallnummer.<br/> <br>\n	Notfallnummer: 079 542 79 35\n</p>\n<h5>Chat für Alle</h5> \n<p>\n	Es gibt einen Telegramchat für alle. Wer sich nicht benimmt, fliegt raus. <a href=\"https://t.me/pio_x\">t.me/pio_x</a>\n</p>'),
