	('mrx_qrcode_page_text','<h1>Was tun als Mister X?</h1> Spass haben!'),
	('passcode_page_subtitle','Der etwas andere Leiter Wettkampf!'),
	('passcode_page_text','<h2>Was muss ich als Erstes tun?</h2>\n<p>\n  Wenn dein Team diesen Zettel erhalten hat, habt ihr bereits den Checkin hinter euch. So geht’s weiter:\n</p>\n<ol>\n  <li>\n    <b>App herunterladen/öffnen:</b>\n    <ol>\n      <li>\n        Android (Google): App im Play Store herunterladen und den Code oben rechts scannen.\n        Sucht im Google Play nach „Pio-X“ oder tippt folgenden Link ein: http://bit.ly/2mUFWPJ\n      </li>\n      <li>\n        iPhone (Apple): Handycode (QR) oben rechts scannen oder mit dem Link einloggen. Fürs iPhone gibt es keine App, es wird direkt im Webbrowser gespielt. (Ab iOS 11 kann der QR Code direkt mit der Kamera gescannt werden. Ältere iPhones verwenden dafür die App „Scanbot“.)\n      </li>\n    </ol>\n  </li>\n  <li>\n    <b>Tutorial:</b> In der App hat es eine erste Station die als Tutorial dient. Klickt diese an und folge den Anweisungen. Dies dient auch als „Technik-Check“ um zu testen ob auf deinem Telefon alles wie gewünscht funktioniert. Falls etwas nicht klappt, melde dich beim Infostand.\n  </li>\n  <li>\n    <b>Teambild:</b> Klickt in der App auf „Rangliste“, dann ganz unten auf „Teambild ändern“ und macht ein Foto eurer Gruppe und ladet das Foto hoch.\n  </li>\n</ol>\n<p>\n  Wenn das geklappt hat, bist du und deine Gruppe startbereit. <b>Lest euch die Regeln durch</b> und besprecht eure Team-Strategie. Es funktioniert etwas nicht? Probiert es nochmals und kommt sonst zum Infostand, wir helfen euch dort weiter. Der Infostand ist beim Checkin.\n</p>\n <b>Tipp:</b> Wenn ihr den Checkin gemacht und das Tutorial durchgespielt habt, dann macht euch schon vor Spielbeginn auf den Weg. Eine Startposition weit weg von jeder anderen Gruppe hilft euch, die eroberten Kolonien so lange wie möglich zu behalten.\n</p>\n<h2>Regeln</h2>\n<ul>\n  <li>Man darf nur zu Fuss oder ÖV unterwegs sein. <b>Velos sind nicht erlaubt.</b></li>\n  <li>Auf dem Foto muss immer die <b>ganze Gruppe</b> (ausser der Fotograf) und die Station im Bild sein.</li>\n  <li>Keine Stationen aus dem Bus/Zug heraus einnehmen.</li>\n  <li>Die Gruppe darf sich nicht trennen.</li>\n  <li>&#9884; Wir sind Pfadis und verhalten uns auch so. &#9884;</li>\n</ul>\n\n<br>\n<br>\n<br>\n<br>\n<br>\n<br>\n<br>\n<h2>Wie funktioniert das Spiel?</h2>\n<p>Wer am Ende am meisten Punkte hat, gewinnt. Punkte könnt ihr auf drei Arten machen:</p>\n<ol>\n  <li>\n    <b>Stationen erobern</b><br/>\n    Auf dem Spielfeld siehst Stationen, welche du einnehmen kannst. Klick auf die Station, mach ein Foto deiner ganzen Gruppe und lade das Foto hoch. Damit gehört die Station euch! Zumindest solange Sie euch kein anderes Team wegschnappt. Alle 5 Minuten bekommt ihr Punkte für jede Station in eurem Besitz.\n  </li>\n  <li>\n    <b>Mister X fangen</b><br/>\n    In der Stadt sind ein bis zwei Mister X unterwegs. Ihr seht sie anhand vom Pio-X Logo auf der Karte. Sobald ihr einen gefangen habt, bekommt ihr einen Passcode, welche euch viele Bonuspunkte bringt. Der Passcode kann in der App eingegeben und damit eingelöst werden. Jeder Mister X, den ihr gefangen habt, verschwindet von der Karte. Sind keine mehr sichtbar, habt ihr alle gefangen.\n  </li>\n  <li>\n    <b>Rätsel lösen</b><br/>\n    Auf der Karte gibt es einige Fragezeichen. Wenn ihr bei einem Fragezeichen seid, könnt ihr die Frage freischalten und danach lösen. Es gibt Einzelfragen, aber auch Rätselserien. Rätselserien geben komplett gelöst deutlich mehr Punkte als Einzelrätsel.\n  </li>\n</ol>\n<h2>Häufige Fragen / Tipps & Tricks</h2>\n<ul>\n  <li>\n    Schaltet den Bildschirm vom Handy aus, wenn ihr unterwegs seid und die Karte nicht braucht. Das Spiel braucht viel Akku und ihr wollt nicht nach dem halben Spiel aufgeben müssen.\n  </li>\n  <li>\n    Standortbestimmung einschalten: (Falls der Standort nicht richtig angezeigt wird)\n    <ul>\n      <li>\n        <b>Android / Google Handy</b><br/>\n        In den Einstellungen auf „Standort“. Der Modus muss dort auf „Hohe Genauigkeit“ gestellt werden. Der Energiesparmodus muss ausgeschaltet sein.<br/>\n        &#9888; Wenn die App anzeigt, dass GPS nicht gefunden werden kann, wechselt kurz in eine andere App und dann wieder zurück in die Pio-X App.\n      </li>\n      <li><b>iPhone / Apple Handy</b><br/>\n        In den Einstellungen auf „Datenschutz“ und dort auf „Ortungsdienste“.\n      </li>\n    </ul>\n  </li>\n  <li>Es können mehrere Personen pro Team gleichzeitig eingeloggt sein.</li>\n</ul>\n<h2>&#9888; Hilfe! &#9888; </h2>\n<p>Wenn ihr Probleme irgendwelcher Art habt, meldet euch <b>per Whatsapp oder SMS auf der Notfallnummer</b>. Meldet euch immer per Chat, Anrufe nur bei einem Notfall! Die Notfallnummer lautet 079 542 79 35. Bei <b>medizinischen Notfällen direkt die Ambulanz (144)</b> anrufen und anschliessend die Notfallnummer.</p>\n<p>Notfallnummer: 079 542 79 35</p>\n<h2>Chat für Alle</h2> \n<ul><li>\n	&#9734; Es gibt einen Telegramchat für alle. Wer sich nicht benimmt, fliegt raus. <b>t.me/pio_x</b>\n</li></ul>'),
